import './Login.css';
import Dialog from '@mui/material/Dialog';
import Modal from 'react-bootstrap/Modal';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { useState } from 'react';

const Login = (props) => {
    const [loginSignUp, setLoginSignUp] = useState(true);
    return (
        <>
            <Modal
                {...props}
                size="lg"
                aria-labelledby="example-modal-sizes-title-lg"
                centered
            >
                <Modal.Body style={{ padding: 0 }}>
                    <Row style={{ height: '550px', color: 'white' }}>
                        <Col
                            style={{ backgroundColor: '#2874f0' }}
                            lg={5}
                            md={5}
                            sm={0}
                            xs={0}
                        >
                            <div className="contanerFirst">
                                {loginSignUp ? (
                                    <>
                                        <h3>Login!</h3>
                                        <p>
                                            Sign up with your mobile number to
                                            get started
                                        </p>
                                    </>
                                ) : (
                                    <>
                                        {' '}
                                        <h3>Looks like you're new here!</h3>
                                        <p>
                                            Sign up with your mobile number to
                                            get started
                                        </p>
                                    </>
                                )}
                            </div>
                        </Col>
                        <Col lg={7} md={7} sm={12} xs={12}>
                            <div className="inputData">
                                <TextField
                                    id="standard-basic"
                                    label="Enter Mobile number"
                                    variant="standard"
                                    size="medium"
                                    fullWidth={true}
                                />
                                <TextField
                                    style={{ marginTop: '20px' }}
                                    id="standard-basic"
                                    label="Enter Password"
                                    variant="standard"
                                    size="medium"
                                    fullWidth={true}
                                />

                                <p
                                    style={{
                                        color: 'black',
                                        marginTop: '20px',
                                    }}
                                >
                                    By continuing, you agree to Flipkart's Terms
                                    of Use and Privacy Policy.
                                </p>

                                <div className="buttonAliment">
                                    <Button
                                        style={{ backgroundColor: '#f86418' }}
                                    >
                                        Login
                                    </Button>
                                    <p style={{ marginTop: '20px' }}>OR</p>
                                    <Button
                                        className="loginButton"
                                        style={{
                                            backgroundColor: '#ffff',
                                            marginTop: '20px',
                                            marginBottom: '20px',
                                            color: '#2874f0',
                                            boxShadow:
                                                '0 2px 4px 0 rgb(0 0 0 / 20%)',
                                        }}
                                    >
                                        Request otp
                                    </Button>
                                    <p>New to flipcart? Create an account</p>
                                </div>
                            </div>
                        </Col>
                    </Row>
                </Modal.Body>
            </Modal>
        </>
    );
};

export default Login;
